import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
import { connect } from "react-redux";
import { getTeamData } from "../../actions/Teams/TeamsAPI";
import Team from "../Teams/Team";

const mapDispatchToProps = dispatch => {
  return {
    setTeam: team => dispatch(setTeam(team)),
    getTeamData: team => dispatch(getTeamData(team))
  };
};

const mapStateToProps = state => {
  console.log(state);
  return {
    teams: state.teamReducer.data
  };
};

class ConferenceOne extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    console.log(this.props);
    return (
      <div className="flex flex-row justify-center flex-wrap">
        {this.props.teams
          ? this.props.teams.map(team => {
              return (
                <div
                  onClick={() => this.props.getTeamData(team)}
                  key={team["id"]}
                  className="m-8"
                >
                  <Link className="Link-style" to={`/team/${team}`}>
                    {team}
                  </Link>
                </div>
              );
            })
          : ""}
        <Route path={`/team/:teamName`} render={props => <Team {...props} />} />
      </div>
    );
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(ConferenceOne);
